import React from "react";

const Header = () => {
    return (
        <React.Fragment>
            <div id="title_text_div"> <h3>cryptofeeder.com</h3> </div>
            <div id="login_signup_button_div">
                <button id="login_button" className="button_primary">Login</button>
                <button id="signup_button" className="button_primary">Sign Up</button>
            </div>
        </React.Fragment>
    )
};

export default Header;
